import React from 'react';
import './Item.css'
import { Link } from 'react-router-dom';

const Item = (props) => {
    return (
        <div onClick={window.scrollTo(0,0)} className='item'>
            <Link to={`/product/${props.id}`}>
                <img src={props.image} alt="" />
            </Link>

            <div className='item-price'>
                <span>{props.brand}</span>
                <h5>{props.name}</h5>
                <h4>${props.price}</h4>
            </div>
        </div>
    );
};

export default Item;
